import React from "react";
import styled from "styled-components";
import peoplesData from "../../data/peoples.json"; // Import the JSON data
import businessData from "../../data/peoples.json"; // Import the JSON data

//Images
import QR from "../../assets/qr.png";
import Transfer from "../../assets/transfer.png";
import BankTransfer from "../../assets/bank.png";
import Bill from "../../assets/bill.png";
import Adil from "../../assets/adil.jpg";
import Down from "../../assets/down.png";

export default function MiddleScan() {
  return (
    <>
      <div>
        <MiddleFirst>
          <EachMiddle>
            <EachMiddleImgCont>
              <img src={QR} alt="QR" />
            </EachMiddleImgCont>
            <P>
              Scan any <br /> QR code
            </P>
          </EachMiddle>
          <EachMiddle>
            <EachMiddleImgCont>
              <img src={Transfer} alt="Transfer" />
            </EachMiddleImgCont>
            <P>
              Send <br /> money
            </P>
          </EachMiddle>
          <EachMiddle>
            <EachMiddleImgCont>
              <img src={BankTransfer} alt="Bank Transfer" />
            </EachMiddleImgCont>
            <P>
              Bank <br /> Transfer
            </P>
          </EachMiddle>
          <EachMiddle>
            <EachMiddleImgCont>
              <img src={Bill} alt="Bill" />
            </EachMiddleImgCont>
            <P>
              Recharge <br /> and bills
            </P>
          </EachMiddle>
        </MiddleFirst>
        <Upiid>UPI ID: adilkt16@oksbi</Upiid>

        <MiddleSecond>
          <H3>People</H3>
          <AllPeople>
            {peoplesData.peoples.map((person) => (
              <EachPeople key={person.id}>
                <PeopleImgCont>
                  {person.letter_or_link.type === "text" ? (
                    <LetterDiv>
                      <PeopleImgText style={{ backgroundColor: person.color }}>
                        {person.letter_or_link.value}
                      </PeopleImgText>
                    </LetterDiv>
                  ) : (
                    <PeopleImg
                      src={person.letter_or_link.value}
                      alt="Each person"
                    />
                  )}
                </PeopleImgCont>
                <PeopleP>{person.name}</PeopleP>
              </EachPeople>
            ))}

            {/* {peoplesData.peoples.map((person) => (
              <EachPeople key={person.id}>
                <PeopleImgCont>
                  <PeopleImg src={person.letter} alt="Each person" />
                </PeopleImgCont>
                <PeopleP>{person.name}</PeopleP>
              </EachPeople>
            ))} */}
            {/* /////////////////////////////// */}
            {/* <EachPeople>
              <PeopleImgCont>
                <PeopleImg src={Adil} alt="Each person" />
              </PeopleImgCont>
              <PeopleP>Fayez</PeopleP>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <PeopleImg src={Adil} alt="Each person" />
              </PeopleImgCont>
              <PeopleP>Fayez</PeopleP>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <PeopleImg src={Adil} alt="Each person" />
              </PeopleImgCont>
              <PeopleP>Fayez</PeopleP>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <PeopleImg src={Adil} alt="Each person" />
              </PeopleImgCont>
              <PeopleP>Fayez</PeopleP>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <PeopleImg src={Adil} alt="Each person" />
              </PeopleImgCont>
              <PeopleP>Fayez</PeopleP>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <PeopleImg src={Adil} alt="Each person" />
              </PeopleImgCont>
              <PeopleP>Fayez</PeopleP>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <PeopleImg src={Adil} alt="Each person" />
              </PeopleImgCont>
              <PeopleP>Fayez</PeopleP>
            </EachPeople> */}
            <EachPeople>
              <PeopleImgContDown>
                <PeopleImgDown src={Down} alt="Down Arrow" />
              </PeopleImgContDown>
              <PeopleP>More</PeopleP>
            </EachPeople>
          </AllPeople>
        </MiddleSecond>

        <MiddleBusiness>
          <H3>Businesses</H3>
          <AllPeople>
            <EachPeople>
              <PeopleImgCont>
                <PeopleImg src={Adil} alt="Each person" />
              </PeopleImgCont>
              <PeopleP>Shawarma</PeopleP>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <PeopleImg src={Adil} alt="Each person" />
              </PeopleImgCont>
              <PeopleP>Shawarma</PeopleP>
            </EachPeople>
            <EachPeople>
              <PeopleImgCont>
                <PeopleImg src={Adil} alt="Each person" />
              </PeopleImgCont>
              <PeopleP>Shawarma</PeopleP>
            </EachPeople>
            <EachPeople>
              <PeopleImgContDown>
                <PeopleImgDown src={Down} alt="Down Arrow" />
              </PeopleImgContDown>
              <PeopleP>More</PeopleP>
            </EachPeople>
          </AllPeople>
        </MiddleBusiness>
      </div>
    </>
  );
}

const MiddleFirst = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  text-align: center;
  font-size: 12px;
  padding: 10px 0;
  margin: 0 20px;
`;
const EachMiddle = styled.div``;
